<h1>Fel</h1>

Kommandot "$d" avslutades med en felkod. Operationen kanske inte
har blivit utförd.

<p>

Här är utskriften från kommandot, kanske du kan finna en förklaring:

<p>

<dl><dt><dd>
<pre>
$g{[ingen utskrift]}
</pre>
</dl>
